import React from "react";

const LoginFormStyled=styled.form`
display:flex;
margin:0 auto;
`;

class LoginForm extends React.Component {
  render() {
    return (
      <form className="login-form">
        <h2 className="login-form__title">{this.props.title}</h2>

        <div className="login-form__input-container">{this.props.children}</div>

      </form>
    );
  }
}
export default LoginForm;
